INSERT INTO `ps_product_lang` VALUES (1,1,1,' <p align=\"justify\">Sklep =mlamp.pl= przedstawia lamp stoow z serii ASTRA, ktra czy cechy klasycznej oprawy ze <strong>stylem glamour</strong>. Na smukej podstawie w kolorze chromu umocowano tradycyjny abaur z biaego materiau, ktry zosta ozdobiony uroczymi <strong>krysztakami na acuszkach</strong>. Ta elegancka oprawa wprowadzi do Twojego domu wyrafinowan atmosfer luksusu. W sypialni stworzy przyjemny nastrj, rozjaniajc wntrze <strong>migoczc iluminacj</strong>, w salonie natomiast przycignie wzrok goci i domownikw. Take w lokalach komercyjnych, takich jak hotele czy restauracje, sprawdzi si doskonale.</p> <p align=\"justify\">Oprawy doskonale prezentuj si pojedynczo oraz jako instalacje wietlne, tworzc niesamowite efekty podkrelajce wyjtkowy wystrj i charakter Twoich pomieszcze.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno rdo wiata.</p> <p><strong>Specyfikacja:</strong> <br />Materiay: metal / tkanina / kryszta <br />Wykoczenie: chrom <br />Kolor: biay - przezroczysty (MTM1953/1 WH) / czarny - przezroczysty (MTM1953/1 BK)</p> <p><strong>Wymiary:</strong> <br /> Wysoko cakowita : 45 cm <br /> Szeroko: 25 cm <br /> Regulacja kta wiata: nie <br />Stopie szczelnoci: IP20</p> <p>rda wiata (brak w komplecie): 1 x E14 / 230V / max 40W <br />Oprawa dostosowana jest do rde wiata o klasach energetycznych od A++ do E oraz arwek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','abazurowa-lampa-glamour-astra-mtm1953-1-wh-italux-stojaca-lampka-nocna-stolowa-okragla-krysztalki-crystal-biala','','','','Abaurowa LAMPA glamour ASTRA MTM1953/1 WH Italux stojca LAMPKA nocna stoowa okrga krysztaki crystal biaa','','','',''),(2,1,1,' <p align=\"justify\">Oprawa wiszca z serii ISLA oferowanej w sklepie =mlamp.pl= spodoba si osobom poszukujcym niecodziennych rozwiza w kwestii owietlenia. Ten <strong>szykowny yrandol</strong> pasuje bowiem do wntrz utrzymanych zarwno w stylistyce klasycznej, jak i <strong>glamour</strong> czy nowoczesnej. Imponujcy, owalny abaur z biaej przezroczystej tkaniny kryje w sobie miejsce na cztery rda wiata oraz ozdoby w formie <strong>krysztaowych zwisw-sopli </strong>. Rozjani kade pomieszczenie mieszkalne czy komercyjne dodajc mu niepowtarzalnego charakteru.</p> <p><strong>Specyfikacja:</strong> <br />Materiay: metal | szko | tkanina <br />Kolor: biay</p> <p><strong>Wymiary:</strong> <br /> Wysoko cakowita (regulowana): do 100 cm <br /> Szeroko: 70 cm x 18 cm <br />Wysoko oprawy bez zawieszenia: 24 cm<br />Szeroko podsufitki: 44 cm x 4,5 cm <br />Stopie szczelnoci: IP20</p> <p>rda wiata (brak w komplecie): 4 x E14 / 230V / max 40W (cznie 160W) <br />Moliwo zastosowania arwek energooszczdnych lub LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','abazurowa-lampa-glamour-isla-mdm1870-4-wh-italux-klasyczna-oprawa-krysztalowy-zwis-zyrandol-szklany-crystal-bialy','','','','Abaurowa LAMPA glamour ISLA MDM1870-4 WH Italux klasyczna OPRAWA krysztaowy ZWIS yrandol szklany crystal biay','','','',''),(3,1,1,' <p align=\"justify\"><strong>Kinkiet</strong> z serii LANA dostpnej w sklepie =mlamp.pl= to wiee spojrzenie na styl klasyczny i uzupenienie go paroma drobiazgami, zmieniajcymi cakowicie jego charakter. <strong>Abaur</strong> w ksztacie tuby z biaego materiau to do tradycyjne rozwizanie. Wzbogacenie go jednak o chromowan przyciank oraz kaskad <strong>krysztakw</strong> nadao oprawie wyjtkowego uroku. To doskonay wybr do eleganckich salonw lub sypialni, do ktrych zechcesz wprowadzi nieco luksusowej atmosfery.</p> <p align=\"justify\">Oprawy doskonale prezentuj si pojedynczo oraz jako instalacje wietlne, tworzc niesamowite efekty podkrelajce wyjtkowy wystrj i charakter Twoich pomieszcze.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno rdo wiata.</p> <p><strong>Specyfikacja:</strong> <br />Materiay: metal / tkanina / kryszta <br />Wykoczenie: chrom <br />Kolor: biay - przezroczysty (MBM1787/1 WH) / czarny - przezroczysty (MBM1787/1 BK)</p> <p><strong>Wymiary:</strong> <br /> Wysoko cakowita : 22 cm <br /> Szeroko: 13 cm <br />Gboko (odlego od ciany): 18 cm <br /> Regulacja kta wiata: nie <br />Przewd z wtyczk: brak <br /> Wcznik: brak<br />Stopie szczelnoci: IP20</p> <p>rda wiata (brak w komplecie): 1 x E14 / 230V / max 40W <br />Oprawa dostosowana jest do rde wiata o klasach energetycznych od A++ do E oraz arwek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','abazurowa-lampa-kinkiet-lana-mbm1787-1-wh-italux-kinkiet-oprawa-z-krysztalkami-glamour-crystal-tuba-biala','','','','Abaurowa LAMPA kinkiet LANA MBM1787/1 WH Italux kinkiet OPRAWA z krysztakami glamour crystal tuba biaa','','','',''),(4,1,1,' <p align=\"justify\">Prezentowane owietlenie w sklepie MLAMP.pl charakteryzuje si nowoczesnym ioryginalnym designem. Uniwersalne poczenie kolorw orazwysokiej jakoci materiay, sprawi, e wntrze Twojego domu stanie simiejscem oryginalnym ikomfortowym. Unikalna forma opraw orazelementy dekoracyjne znajd zastosowanie wkadym pomieszczeniu, dziki czemu nabierze ono ponadczasowego charakteru.</p> <p align=\"justify\">Oprawy doskonale prezentuj si pojedynczo oraz jako instalacje wietlne, tworzc niesamowite efekty podkrelajce wyjtkowy wystrj icharakter Twoich pomieszcze.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na trzy rda wiata.</p> <p><strong>Specyfikacja:</strong> <br />Materiay: metal | szko <br />Kolor: zoty - czarny</p> <p><strong>Wymiary:</strong> <br />Wysoko cakowita: 165 cm <br /> Szeroko: 48 cm<br />Waga: 6,2 kg<br />Stopie szczelnoci: IP20</p> <p>rda wiata: 3 x E27 /230V/ max 60W (cznie 180W)<br />Oprawa dostosowana jest do rde wiata o klasach energetycznych od A++ do E oraz arwek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','abazurowa-lampa-podlogowa-drs8006-3ftrbl-mdeco-salonowa-stojaca-zlota-czarna','','','','Abaurowa LAMPA podogowa DRS8006/3FTRBL MDECO salonowa stojca zota czarna','','','',''),(5,1,1,' <p align=\"justify\">Marzysz o <strong>lampie stojcej</strong> w stylu glamour, ktra podkreli wyjtkowy charakter Twojego wntrza? Jeli tak, to z pewnoci spodoba Ci si propozycja zespou =mlamp.pl= z kolekcji ESSENCE. Oprawa pasowa bdzie do aranacji utrzymanych w stylistyce klasycznej, glamour czy nowoczesnej. Abaur pokryty bia, delikatn tkanin kryje w sobie miejsce na <strong>trzy rda wiata</strong>. Cao uzupeniaj dekoracyjne krysztaki, ktre w fenomenalny sposb odbijaj wiato i tworz niepowtarzalne refleksy. Iluminacja rozwietli sypialni, salon czy gabinet tworzc w nich nastrj sprzyjajcy wypoczynkowi.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na trzy rda wiata.</p> <p><strong>Specyfikacja:</strong> <br />Materiay: tkanina | metal <br />Kolor: biay - przezroczysty (MFM9262/3P WH) | czarny - przezroczysty (MFM9262/3P BK)</p> <p><strong>Wymiary:</strong> <br />Wysoko cakowita : 160 cm <br /> Szeroko: 40 cm <br />Regulacja kta wiata: nie <br />Stopie szczelnoci: IP20</p> <p>rda wiata (brak w komplecie): 3 x E14 / 230V / max 40W (cznie 120W) <br />Oprawa dostosowana jest do rde wiata o klasach energetycznych od A++ do E oraz arwek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','abazurowa-lampa-podlogowa-essence-mfm9262-3p-wh-italux-stojaca-oprawa-glamour-organza-z-krysztalkami-biala-przezroczysta','','','','Abaurowa LAMPA podogowa ESSENCE MFM9262/3P WH Italux stojca OPRAWA glamour organza z krysztakami biaa przezroczysta','','','',''),(6,1,1,' <p align=\"justify\">Oferujemy Pastwu owietlenie o unikalnym designie oraz precyzyjnym wykonaniu z najwyszej jakoci materiaw. Lampy idealnie wkomponuj si w klasycznie, jak i nowoczenie urzdzonych wntrzach. <br /><br /> Oprawy doskonale prezentuj si pojedynczo oraz jako instalacje wietlne, tworzc niesamowite efekty podkrelajce wyjtkowy wystrj i charakter Twoich pomieszcze. <br /><br />Prezentowana lampa posiada miejsce na jedno rdo wiata .</p> <p><strong>Dane techniczne:</strong> <br />Materiay: metal / tkanina <br />Wykoczenie: aluminium <br />Kolor: biay</p> <p><strong>Wymiary:</strong> <br /> Wysoko cakowita: 135 cm - 175 cm <br />Szeroko: 75 cm <br />Wysoko klosza: 25 cm</p> <p></p> <p>Stopie szczelnoci: IP20</p> <p>rda wiata (brak w komplecie): 1 x E27 / 230V / max 60W <br />Moliwo zastosowania arwek energooszczdnych lub LED o dowolnej mocy.</p> <p>Produkt posiada wszelkie certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','abazurowa-lampa-podlogowa-terra-small-f0005-maxlight-regulowana-oprawa-stojaca-do-czytania-biala','','','','Abaurowa LAMPA podogowa TERRA SMALL F0005 Maxlight regulowana OPRAWA stojca do czytania biaa','','','',''),(7,1,1,' <p>Elegancki i klasyczny model <strong>owietlenia</strong> w Twojej aranacji wntrz?</p> <p><strong>Poznaj abaurowy kinkiet z kolekcji Abu Dhabi</strong></p> =mlamp.pl= przygotowa specjalnie dla Ciebie <strong><a href=\"https://mlamp.pl/13-lampy-scienne-kinkiety\">lamp cienn</a></strong>, ktra wspaniale odnajdzie si w tradycyjnym <strong><a href=\"https://mlamp.pl/27-lampy-do-salonu\">salonie</a></strong>. Ozdobny <strong>kinkiet</strong> skada si z lnicej oprawy w barwie chromu oraz czarnego abaurowego klosza, ktry otuli cae pomieszczenie agodnym i <strong>ciepym refleksem</strong>. Model <strong>owietlenia</strong> marki EVO z pewnoci upikszy wyszukane przestrzenie, podkrelajc ich szykowny charakter. <strong><strong> Lampa</strong></strong> <p align=\"justify\">Oprawy doskonale prezentuj si pojedynczo oraz jako instalacje wietlne, tworzc niesamowite efekty podkrelajce wyjtkowy wystrj icharakter Twoich pomieszcze.</p> <p align=\"justify\">Lampa posiada miejsce na jedno rdo wiata.</p> <p><strong>Specyfikacja:</strong> <br />Materiay: tkanina | metal <br />Kolor: czarny - chrom (W01397BK) | biay - chrom (W01888WH)</p> <p><strong>Wymiary:</strong> <br />Wysoko cakowita : 25 cm <br /> Szeroko: 14 cm <br />Gboko (odlego od ciany): 22 cm <br />Waga: 1 kg <br />Regulacja kta wiata: nie <br />Przewd z wtyczk: brak <br />Wcznik: brak <br />Stopie szczelnoci: IP20</p> <p>rda wiata (brak w komplecie): 1 x E14 / 230V / max 40W <br />Oprawa dostosowana jest do rde wiata o klasach energetycznych od A++ do E oraz arwek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','abazurowa-lampa-scienna-abu-dhabi-w01397bk-cosmolight-klasyczna-do-salonu-czarna','','','','Abaurowa LAMPA cienna ABU DHABI W01397BK Cosmolight klasyczna do salonu czarna','','','',''),(8,1,1,' <p><strong><a href=\"\">Lampa cienna</a></strong> z kolekcji Abu Dhabi znajdujca si w ofercie =mlamp.pl= to stylowe poczenie elegancji i tradycji.</p> <p><strong>Poznaj nasz klasyczny kinkiet!</strong></p> <p>Kompozycja szykownej oprawy w barwie mosidzu i abaurowego, biaego klosza tej lampy niesamowicie podkreli charakter niejednego <strong><a href=\"https://mlamp.pl/27-lampy-do-salonu\">salonu</a></strong>, a jego forma sprawi, e stanie si jego niezobowizujcym elementem dekoracyjnym. Dekoracyjny <strong>kinkiet</strong> kryje w swoim wntrzu miejsce na <strong><a href=\"https://mlamp.pl/4-zarowki-zrodla-swiatla\">rdo wiata</a></strong> nadajce otoczeniu wyjtkowego <strong>blasku</strong>. Model <strong>owietlenia</strong> mar