 zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','abazurowa-lampa-wiszaca-amore-31-39378-candellux-plisowana-oprawa-zwis-czarny','','','','Abaurowa LAMPA wiszca AMORE 31-39378 Candellux plisowana OPRAWA zwis czarny','','','',''),(78,1,1,' <p align=\"justify\">Sklep =mlamp.pl= przedstawia lamp wiszc z serii ASTRA, ktra czy cechy klasycznej oprawy ze <strong>stylem glamour</strong>. Na podsufitce w kolorze chromu umocowano abaur z czarnego materiau, ktry zosta ozdobiony uroczymi <strong>krysztakami na acuszkach</strong>. Ta elegancka oprawa wprowadzi do Twojego domu wyrafinowan atmosfer luksusu. W kadym wntrzu stworzy przyjemny nastrj, rozjaniajc wntrze <strong>migoczc iluminacj</strong> oraz przycignie wzrok goci i domownikw. Take w lokalach komercyjnych, takich jak hotele czy restauracje, sprawdzi si doskonale.</p> <p align=\"justify\">Oprawy doskonale prezentuj si pojedynczo oraz jako instalacje wietlne, tworzc niesamowite efekty podkrelajce wyjtkowy wystrj i charakter Twoich pomieszcze.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno rdo wiata, a jej wysoko mona regulowa, dziki czemu mona dopasowa j do rnego typu pomieszcze.</p> <p><strong>Specyfikacja:</strong> <br />Materiay: metal / tkanina / kryszta <br />Wykoczenie: chrom <br />Kolor: czarny - przezroczysty</p> <p><strong>Wymiary:</strong> <br /> Wysoko cakowita (regulowana): do 100 cm <br /> Szeroko: 14 cm <br /> Wysoko oprawy (bez zawieszenia): 12 cm <br /> Regulacja kta wiata: nie <br />Stopie szczelnoci: IP20</p> <p>rda wiata (brak w komplecie): 1 x E14 / 230V / max 40W <br />Oprawa dostosowana jest do rde wiata o klasach energetycznych od A++ do E oraz arwek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','abazurowa-lampa-wiszaca-astra-mdm1953-1-bk-italux-okragla-oprawa-glamour-zwis-z-krysztalkami-crystal-czarny','','','