 zoenia sprztu.</p> ','','abazurowa-lampa-wiszaca-crotone-48801sh-45-globo-plisowana-oprawa-abazurowa-led-45w-3000k-6000k-zwis-czarny','','','','Abaurowa LAMPA wiszca CROTONE 48801SH-45 Globo plisowana OPRAWA abaurowa LED 45W 3000K - 6000K zwis czarny','','','',''),(84,1,1,'<p align=\"justify\">Prezentowana przez =mlamp.pl= oprawa to <strong>przycigajca wzrok dekoracja</strong>, ktra zwraca na siebie uwag swoj wyrazist, monochromatyczn kolorystyk, czc stylow czer i biel, ktre <strong>podkrelaj jego elegancj</strong>. Jej niebanalna konstrukcja wykorzystuje form popularnego druciaka i czy j z dodatkowym kloszem, dziki czemu wietnie odnajdzie si w kadym <strong>loftowym i skandynawskim wntrzu</strong>.</p><p align=\"justify\">Prezentowana lampa posiada miejsce na jedno rdo wiata, a jej wysoko mona regulowa na przewodzie, dziki czemu mona dopasowa j do rnego typu pomieszcze.</p><p><strong>Specyfikacja:</strong> <br />Materiay: metal | tworzywo sztuczne | tkanina <br />Kolor: czarny - biay (ELM8802/1 ZWIS - 01) | chrom - biay (ELM8802/1 ZWIS - 05 ) | szary - biay (ELM8802/1 ZWIS - 03)</p><p><strong>Wymiary:</strong> <br />Wysoko cakowita (skracana): 110 cm <br /> Szeroko: 38 cm <br />Wysoko oprawy bez zawieszenia: 42 cm <br />Regulacja kta wiata: nie <br />Stopie szczelnoci: IP20</p><p>rda wiata (brak w komplecie): 1 x E27 / 230V / max 60W <br />Oprawa dostosowana jest do rde wiata o klasach energetycznych od A++ do E oraz arwek LED o dowolnej mocy.</p><p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p>','','abazurowa-lampa-wiszaca-elm8802-1-zwis-01-mdeco-metalowa-oprawa-druciany-zwis-piramida-czarna-biala','','','','Abaurowa LAMPA wiszca ELM8802/1 ZWIS - 01 MDECO metalowa OPRAWA druciany ZWIS piramida czarna biaa','','','',''),(85,1,1,'<p align=\"justify\">Jeli urzdzasz swoje wntrza w stylu industrialnym, loftowym lub nowoczesnym i szukasz do nich <strong>odpowiedni