i: IP20</p> <p>rda wiata (brak w komplecie): 1 x E14 / 230V / max 40W <br />Oprawa dostosowana jest do rde wiata o klasach energetycznych od A++ do E oraz arwek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','angielska-lampa-scienna-filomena-arm390-01-w-maytoni-abazurowa-oprawa-crystal-glamour-kinkiet-ecru','','','','Angielska LAMPA cienna FILOMENA ARM390-01-W Maytoni abaurowa OPRAWA crystal glamour kinkiet ecru','','','',''),(155,1,1,' <p align=\"justify\">W obecnych czasach coraz wicej uwagi powicamy na ochron zdrowia naszego i naszych bliskich. Warto jednak podej do tematu w sposb jak <strong>najbardziej profesjonalny</strong>, dlatego =mlamp.pl= wychodzi naprzeciw oczekiwaniom Klientw dodajc do swojej oferty <strong>lamp do dezynfekcji</strong>. Jak wiadomo promieniowanie UV jest jedn z najskuteczniejszych metod oczyszczania otoczenia i <strong>nieodwracalnie eliminuje</strong> bakterie, wirusy, grzyby czy inne drobnoustroje. Takie produkty wykorzystuje si wszdzie tam, gdzie wrcz wymagana jest <strong>doskonaa sterylno</strong>  szpitale, przychodnie, apteki  aby jak najlepiej chroni zdrowie pacjentw. Warto zakupi j take do swojego hotelu, przedszkola czy nawet na wasny, domowy uytek. Trzeba jednak pamita o kilku wanych aspektach: podczas dziaania urzdzenia, naley <strong>bezwzgldnie opuci</strong> pomieszczenie, aden czowiek ani zwierz nie mog by w jego zasigu, poniewa duszy kontakt moe spowodowa poparzenia skry oraz oczu; naley pozostawi pomieszczenie zamknite na co najmniej 40 minut podczas dezynfekowania. Lampa posiada dwa tryby dezynfekcji: ozonowy i nieozonowy. Przy dezynfekcji ozonowej pomieszczenie naley wietrzy przez conajmniej 40 minut od zakoczenia pracy lampy. Przy dezynfekcji nieozonowej pomieszczenie naley wietrzy przez 20 minut. <br /><br />Lampa posiada w zestawie pilot, za pomoc ktrego moemy ustawi czas dziaania: 15, 30 lub 60 minut. Lampa posiada opnienie rozpoczcia dziaania: 20 sekund.</p> <p><strong>Specyfikacja:</strong> <br />Materiay: metal<br />Kolor: czarny</p> <p><strong>Wymiary:</strong> <br />Wysoko cakowita: 44 cm <br /> Szeroko: 17,5 cm <br />Regulacja kta wiata: nie <br />Stopie szczelnoci:</p> <p>rda wiata (w komplecie): cznie 36W (zainstalowany na stae - niewymienny) / 230V<br /><br /></p> <p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p> ','','antybakteryjna-lampa-stojaca-mdeco-ar-uv-dl-01-metalowa-oprawa-bakteriobojcza-do-dezynfekcji','','','','Antybakteryjna LAMPA stojca MDECO AR-UV-DL-01 metalowa OPRAWA bakteriobjcza do dezynfekcji','','','',''),(156,1,1,' <p align=\"justify\">Prezentowana przez =mlamp.pl= oprawa to kinkiet, ktry wyrnia si <strong>niezwyk ozdobnoci</strong>, wietnie wspgrajc m.in. z aranacjami Art Deco. Baz oprawy jest szklany, pkolisty klosz, ktry zabudowano metalow kratk z kolorze starego srebra. W jej oczkach umieszczono kilkanacie okrgych krysztakw. Takie rozwizanie podkrela wszelkie walory wizualne, sprawiajc, e Lucia to <strong>niepowtarzalna dekoracja</strong>.</p> <p align=\"justify\">Oprawy doskonale prezentuj si pojedynczo oraz jako instalacje wietlne, tworzc niesamowite efekty podkrelajce wyjtkowy wystrj icharakter Twoich pomieszcze.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno rdo wiata.</p> <p><strong>Specyfikacja:</strong> <br />Materiay: metal | kryszta <br />Kolor: srebrny - przezroczysty</p> <p><strong>Wymiary:</strong> <br />Wysoko cakowita : 20,3 cm <br /> Szeroko: 20,3 cm <br />Gboko (odlego od ciany): 11,4 cm <br />Waga: 1,7 kg <br />Regulacja kta wiata: nie <br />Przewd z wtyczk: brak <br />Wcznik: brak <br />Stopie szczelnoci: IP20</p> <p>rda wiata (brak w komplecie): 1 x E14 / 230V / max 60W <br />Oprawa dostosowana jest do rde wiata o klasach energetycznych od A++ do E oraz arwek