ify\">Jedno oko odpowiedzialne za wczanie owietlenia dziennego posiada wmontowany trjstopniowy ciemniacz, drugie oko natomiast pozwala na wczenie trybu nocnego oraz zmian temperatury barwowej wiata a w trzech zakresach.</p><p align=\"justify\">Prezentowana lampa posiada miejsce na dwa rda wiata.</p><p><strong>Specyfikacja:</strong> <br />Materiay: tworzywo sztuczne <br />Kolor: biay (K-BL1601 biaa) | ty (K-BL1601 ta) | rowy (K-BL1601 rowa)</p><p><strong>Wymiary:</strong> <br />Wysoko cakowita : 39 cm <br /> Szeroko: 9,5 cm x 30 cm <br />Szeroko klosza: 10,5 cm <br />Regulacja kta wiata: tak <br />Stopie szczelnoci: IP20</p><p>rda wiata (w komplecie): 2 x modu LED (zainstalowany na stae - niewymienny) / 230V / 6W <br />Barwa wiata: 3000K (biaa ciepa) - 6000K (biaa zimna) <br />Liczba lumenw: 350lm</p><p>Produkt posiada certyfikaty zgodnoci i objty jest GWARANCJ PRODUCENTA. <br />Zestaw zawiera instrukcj obsugi oraz elementy niezbdne do zoenia sprztu.</p>','','biurkowa-lampa-stojaca-k-bl1601-biala-kaja-dziecieca-lampka-stolowa-led-6w-3000k-6000k-zyrafa-biala','','','','Biurkowa LAMPA stojca K-BL1601 biaa Kaja dziecica LAMPKA stoowa LED 6W 3000K-6000K yrafa biaa','','','',''),(191,1,1,'<p align=\"justify\">Urocza <strong>lampka biurkowa</strong> w ksztacie sonika z pewnoci stanie si jednym z ulubionych elementw wystroju pokoju Twojego dziecka. Ten uroczy, <strong>rowy sonik</strong> posiada dwa wbudowane moduy LED  na kocu trby oraz na brzuszku  dziki czemu jest to <strong>praktyczne i energooszczdne rozwizanie</strong>, pozwalajce na stopniowanie poziomu nawietlenia w pomieszczeniu. Prezentowany przez =mlamp.pl= model wspaniale owietli wntrze, tworzc w nim przyjazn atmosfer. Doskonale sprawdzi si jako prezent na wiele okazji, wywoujc szczery umiech dziecka</p><p align=\"justify\">Jedno oko odpowiedzialne za wczanie owietlenia dziennego (na kocu trby) posiada wmontowany trjstopniowy ciemniacz, drugie oko natomiast pozwala na wczenie trybu nocnego oraz zmian temperatury